import React from 'react'
import { projectsData } from './Data'
import { projectsNav } from './Data'

const Works = () => {
  return (
   <div className="work__filter">
    {projectsNav.map((item, index)  => {
        return(
            <span className="work__item">{item.name}</span>
        )
    })}
   </div>
  )
}

export default Works
